//inicializacion de express
const app = express()

//cofiguracion de puerto -> 3000
app.set('port',config.port)

//midleware
app.use(cors())
app.use(morgan('dev'))
app.use(express.urlencoded({extended:false}))
app.use(express.json())

//Rutas del servidor
app.use("/products",productsRoutes)

export default app

